using MediaInsights.Reports;
using Microsoft.Reporting.WinForms;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Xml;

namespace ConsoleApplication1
{
	class Program
	{
		static void Main(string[] args)
		{
			GenerateReport();
			//Test();

			Console.ReadLine();
		}

		private static void GenerateReport()
		{
			XmlDocument x = new XmlDocument();
			x.Load("D:\\CoverPage.rdlc");

			XmlNode node = x.LastChild.FirstChild.NextSibling.FirstChild.FirstChild.FirstChild;
			if (node == null) return;

			XmlNode embeddedImagesNode = x.LastChild;
			foreach (XmlNode n in x.LastChild.ChildNodes)
			{
				if (n.Name == "EmbeddedImages") {
					embeddedImagesNode = n;
					break;
				}
			}

			StringBuilder report = new StringBuilder();

			ChartReport cr = new ChartReport("test", 31.5);
			report.Append(cr.Title("News Volume"));
			report.Append(cr.TitleLine());
			report.Append(cr.Summary("The quick brown fox"));

			ChartAnalysisReport car = new ChartAnalysisReport("test", 31.5);
			report.Append(car.ChartLineTop());
			report.Append(car.Image());
			report.Append(car.ChartLineBottom());
			report.Append(car.GenerateCallout("Some callout"));

			string paragraph = car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			paragraph += car.GenerateChartExplanationParagraph(null, false, false);
			paragraph += car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			report.Append(car.GenerateChartExplanation(paragraph));

			car.StartLocationTop += ChartAnalysisReport.ReportHeight + 0.5;

			car.Name = "test2";
			report.Append(car.ChartLineTop());
			report.Append(car.Image());
			report.Append(car.ChartLineBottom());
			report.Append(car.GenerateCallout("Some callout"));

			paragraph = car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			paragraph += car.GenerateChartExplanationParagraph(null, false, false);
			paragraph += car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			report.Append(car.GenerateChartExplanation(paragraph));

			double lastItemBottomLocation = car.StartLocationTop + ChartAnalysisReport.ReportHeight;
			report.Append(cr.PageBreak(lastItemBottomLocation));

			// New Chart
			cr = new ChartReport("21", lastItemBottomLocation + ChartReport.PageBreakHeight);
			report.Append(cr.Title("Another Volume"));
			report.Append(cr.TitleLine());
			report.Append(cr.Summary("The quick brown fox"));

			car = new ChartAnalysisReport("21", lastItemBottomLocation + ChartReport.PageBreakHeight);
			report.Append(car.ChartLineTop());
			report.Append(car.Image());
			report.Append(car.ChartLineBottom());
			report.Append(car.GenerateCallout("Some callout"));

			paragraph = car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			paragraph += car.GenerateChartExplanationParagraph(null, false, false);
			paragraph += car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			report.Append(car.GenerateChartExplanation(paragraph));

			car.StartLocationTop += ChartAnalysisReport.ReportHeight + 0.5;

			car.Name = "22";
			report.Append(car.ChartLineTop());
			report.Append(car.Image());
			report.Append(car.ChartLineBottom());
			report.Append(car.GenerateCallout("Some callout"));

			paragraph = car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			paragraph += car.GenerateChartExplanationParagraph(null, false, false);
			paragraph += car.GenerateChartExplanationParagraph("Title Explanation Summary", true, false);
			paragraph += car.GenerateChartExplanationParagraph("Some explanation summary.", false, false);
			report.Append(car.GenerateChartExplanation(paragraph));

			//

			var dict = new Dictionary<string, string>() {
				{"Imagetest", "" },
				{"Imagetest2", "" },
				{"Image21", "" },
				{"Image22", "" },
			};
			embeddedImagesNode.InnerXml += cr.EmbeddedImage(dict);

			node.InnerXml += report.ToString();

			XmlDocument xDoc = new XmlDocument();
			xDoc.LoadXml(x.OuterXml);
			xDoc.Save("D:\\test.rdlc");

			LocalReport lr = new LocalReport();
			lr.ReportPath = "D:\\test.rdlc";
			lr.SetParameters(
				new ReportParameter[] {
					new ReportParameter("brief", "Samsung"),
					new ReportParameter("briefPeriod", "February - June 2015"),
					new ReportParameter("executiveSummary", "Test Executive Summary"),
					});

			byte[] bytes = lr.Render("WORDOPENXML");

			using (FileStream fs = new FileStream(@"D:\test.docx", FileMode.Create))
			{
				fs.Write(bytes, 0, bytes.Length);
			}
		}

		private static void Test()
		{
			XmlDocument doc = new XmlDocument();
			doc.LoadXml("<book xmlns:bk='urn:samples' bk:ISBN='1-861001-57-5'>" +
						"<title>Pride And Prejudice</title>" +
						"</book>");

			XmlNode root = doc.FirstChild;

			//Create a new attribute.
			XmlNode attr = doc.CreateNode(XmlNodeType.Attribute, "genre", null);
			attr.Value = "novel";

			//Add the attribute to the document.
			root.Attributes.SetNamedItem(attr);

			Console.WriteLine("Display the modified XML...");
			doc.Save(Console.Out);
		}
	}
}
